import React, { Component } from "react";
import bg from "../../assets/bg.jpg";
import logo from "../../assets/logo.png";
import "./HomeComponent.css";
import { Redirect } from "react-router-dom";

class HomeComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      signup: false,
      login: false
    };
    this.signup = this.signup.bind(this);
    this.login = this.login.bind(this);
  }
  signup() {
    this.setState({ signup: true });
  }
  login() {
    this.setState({ login: true });
  }
  render() {
    if (this.state.signup) return <Redirect to="/performance" />;
    if (this.state.login) return <Redirect to="/dashboard" />;
    return (
      <div className="app-contain">
        <img src={bg} alt="homeimage" className="home-image" />
        <div className="main">
          <img src={logo} alt="homeimage" className="logo" />
          <h1>RDBAlert</h1>
          <h2>HEADLINE GOES HERE</h2>
          <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit , sed do
            eiusmod tempor incididunt ut labore et dolore magna aliqua.
          </p>
          <div className="signup-login">
            <button type="signup" className="signup-btn" onClick={this.signup}>
              SignUp
            </button>
            <button type="login" className="login-btn" onClick={this.login}>
              Login
            </button>
          </div>
        </div>
      </div>
    );
  }
}

export default HomeComponent;
